import React, { useContext } from 'react';
import AppContext from './utils/AppContext'; // Ajusta esta ruta según tu estructura de carpetas

const Navbar = () => {
  const { state, dispatch } = useContext(AppContext);

  const handleThemeChange = () => {
    dispatch({ type: 'TOGGLE_THEME' });
  };

  return (
    <nav className="navbar">
    <Link to="/home">Home</Link>
    <Link to="/contacto">Contacto</Link>
    <Link to="/favs">Favoritos</Link>
    <Link to="/dentist/:id">Dentistas</Link>
    <button className="toggle-theme-button" onClick={handleThemeChange}>Toggle Theme</button>
  </nav>
  );
};

export default Navbar;
